:"stdout","output_type":"stream","text":["\n","Naive Bayes Model Evaluation\n"]},{"data":{"text/plain":["Confusion Matrix and Statistics\n","\n","          Reference\n","Prediction No Yes\n","       No  35   8\n","       Yes  4  12\n","                                          \n","               Accuracy : 0.7966          \n","                 95% CI : (0.6717, 0.8902)\n","    No Information Rate : 0.661           \n","    P-Value [Acc > NIR] : 0.01668         \n","                                          \n","                  Kappa : 0.5229          \n","                                          \n"," Mcnemar's Test P-Value : 0.38648         \n","                                          \n","            Sensitivity : 0.8974          \n","            Specificity : 0.6000          \n","         Pos Pred Value : 0.8140          \n","         Neg Pred Value : 0.7500          \n","             Prevalence : 0.6610          \n","         Detection Rate : 0.5932          \n","   Detection Prevalence : 0.7288          \n","      Balanced Accuracy : 0.7487          \n","                                          \n","       'Positive' Class : No              \n","                                          "]},"metadata":{},"output_type":"display_data"}],"source":["# Confusion matrix and classification metrics for each model\n","cat(\"\\nLogistic Regression Model Evaluation\")\n","confusionMatrix(as.factor(log_reg_pred_class), as.factor(test_data$target))\n","\n","cat(\"\\nDecision Tree Model Evaluation\")\n","confusionMatrix(dt_pred, as.factor(test_data$target))\n","\n","cat(\"\\nRandom Forest Model Evaluation\")\n","confusionMatrix(rf_pred, as.factor(test_data$target))\n","\n","cat(\"\\nSupport Vector Machine Model Evaluation\\n\")\n","confusionMatrix(svm_pred, as.factor(test_data$target))\n","\n","cat(\"\\nk-Nearest Neighbor Model Evaluation\\n\")\n","confusionMatrix(knn_pred, as.factor(test_data$target))\n","\n","cat(\"\\nNaive Bayes Model Evaluation\\n\")\n","confusionMatrix(nb_pred, as.factor(test_data$target))"]},{"cell_type":"markdown","id":"f7fce6ae","metadata":{"papermill":{"duration":0.021722,"end_time":"2024-12-21T07:29:23.014964","exception":false,"start_time":"2024-12-21T07:29:22.993242","status":"completed"},"tags":[]},"source":["### **Model Evaluation Findings**\n","\n","#### 1. **Model Accuracy**\r\n","   - Logistic Regression, Random Forest, SVM, k-NN, and Naive Bayes models all have an **accuracy of 79.66%**, while the Decision Tree model has a lower accuracy of **72.88%**.\r\n","   - The accuracy is above the No Information Rate (NIR) of **66.1%**, and the **P-value for Acc > NIR** confirms statistical significance (P = 0.01668 for most models).\r\n","\r\n","#### 2. **Confusion Matrix Metrics**\r\n","   - **Sensitivity (Recall for \"No\" class):**\r\n","     - High sensitivity across models like Logistic Regression (92.31%), Random Forest (94.87%), and SVM (94.87%), indicating strong performance in identifying true negatives (correctly predicting \"No\").\r\n","     - Decision Tree (84.62%) and Naive Bayes (89.74%) perform slightly lower.\r\n","   - **Specificity (Recall for \"Yes\" class):**\r\n","     - Specificity is relatively low across all models, hovering around **50-60%**, indicating weaker performance in identifying true positives (correctly predicting \"Yes\").\r\n","   - **Positive Predictive Value (Precision for \"No\" class):**\r\n","     - Most models show decent precision (~78-80%) for the \"No\" predictions.\r\n","   - **Negative Predictive Value (Precision for \"Yes\" class):**\r\n","     - Precision for \"Yes\" is relatively consistent (72.5%-83.3%).\r\n","\r\n","#### 3. **Balanced Accuracy**\r\n","   - Reflects the average of sensitivity and specificity:\r\n","     - Logistic Regression has **73.65%** balanced accuracy.\r\n","     - Decision Tree performs slightly worse at **67.31%**.\r\n","     - Random Forest, SVM, k-NN, and Naive Bayes hover around **72.44-74.87%**.\r\n","\r\n","#### 4. **Kappa Statistics**\r\n","   - Indicates the agreement between observed and predicted classifications beyond chance:\r\n","     - Logistic Regression: **0.5104** (moderate agreement).\r\n","     - Random Forest, SVM, and k-NN: **0.4972** (moderate agreement).\r\n","     - Decision Tree: **0.3639** (fair agreement).\r\n","     - Naive Bayes: **0.5229** (slightly better agreement).\r\n","\r\n","#### 5. **Statistical Significance**\r\n","   - McNemar's Test P-Value:\r\n","     - Aims to detect significant differences between types of errors in the confusion matrix.\r\n","     - Random Forest, SVM, and k-NN (P = 0.04331) show some asymmetry in errors, suggesting room for improvement.\r\n","     - Other models have higher P-values, indicating less significant error imbalance."]},{"cell_type":"markdown","id":"37f1f348","metadata":{"papermill":{"duration":0.022326,"end_time":"2024-12-21T07:29:23.058752","exception":false,"start_time":"2024-12-21T07:29:23.036426","status":"completed"},"tags":[]},"source":["## **Conclusion**\n","\n","- Logistic Regression, Random Forest, SVM, k-NN, and Naive Bayes exhibit similar and strong performance, achieving good overall accuracy, sensitivity, and balanced accuracy.\n","- The Decision Tree model underperforms relative to others, with lower accuracy, sensitivity, and kappa statistics.\n","- Low specificity across models suggests that while predicting the absence of heart disease is effective, distinguishing cases with heart disease remains challenging."]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[],"dockerImageVersionId":30751,"isGpuEnabled":false,"isInternetEnabled":true,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.4.0"},"papermill":{"default_parameters":{},"duration":17.908488,"end_time":"2024-12-21T07:29:23.201266","environment_variabl